import React from 'react';
import { Box, Typography, TextField, Button } from '@mui/material';
import Grid from '@mui/material/Grid';
import { Link } from 'react-router-dom';

const Register = () => {
  return (
    <Box
      sx={{
        position: 'fixed',
        top: 0,
        left: 0,
        width: '100%',
        height: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#f0f0f0',
      }}
    >
      <Grid container sx={{ maxWidth: '900px', height: '600px', boxShadow: 3, borderRadius: '12px', overflow: 'hidden' }}>
        {/* Left Side - Welcome Back Message */}
        <Grid
          item
          xs={12}
          sm={6}
          sx={{
            backgroundColor: '#26a69a',
            color: '#fff',
            padding: '2rem',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            height: '100%',
          }}
        >
          <Typography variant="h4" gutterBottom>
            Welcome Back!
          </Typography>
          <Typography variant="body1" sx={{ marginBottom: '2rem', textAlign: 'center' }}>
            To keep connected with us please login with your personal info.
          </Typography>
          <Link to="/login">
            <Button
              variant="contained"
              sx={{
                backgroundColor: '#fff',
                color: '#26a69a',
                '&:hover': {
                  backgroundColor: '#e0e0e0',
                },
              }}
            >
              Sign In
            </Button>
          </Link>
        </Grid>

        {/* Right Side - Create Account Form */}
        <Grid
          item
          xs={12}
          sm={6}
          sx={{
            backgroundColor: '#fff',
            padding: '2rem',
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            height: '100%',
          }}
        >
          <Typography variant="h4" sx={{ marginBottom: '1rem' }}>
            Create Account
          </Typography>

          <Box component="form" sx={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
            <TextField label="Firstname" variant="outlined" fullWidth />
            <TextField label="Lastname" variant="outlined" fullWidth />
            <TextField label="Email" variant="outlined" fullWidth />
            <TextField label="Username" variant="outlined" fullWidth />
            <TextField label="Password" variant="outlined" fullWidth type="password" />
            <TextField label="Confirm Password" variant="outlined" fullWidth type="password" />

            <Button variant="contained" color="primary" sx={{ marginTop: '1rem' }}>
              Sign Up
            </Button>
          </Box>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Register;
